import regice from './assets/regice.png';
import './App.css';

export default function App() {
  return (
    <div className="App">
      <h1>Hello World</h1>
      <Regice />
      <Regice />
      <Regice />
    </div>
  );
}

function Regice() {
  return (
    <img src={regice} size='10%' />
  );
}
